import { Grid } from "@mui/material"
import  CardContent from "@mui/material/CardContent";
import React from "react";

const CardContentUser = ({task}) => {
    return (
        <Card> 
            {"-" + task.nombre}
            <Grid container>
                <Grid item xs={9}>
                    Oficina:
                    <br></br>
                    Hora:                
                </Grid>
                <Grid item xs={3}>
                   {task.oficina}
                    <br></br>
                    {task.hora}
                    Hora:                
                </Grid>
            </Grid>
        </Card> 
    )
}
export default CardContentUser;
